window.bookSummaryJSON = "<p>He'll get her home safe...or he'll die trying....</p> <p>Honey Honig is used to infiltrating the most dangerous places on Earth and thwarting kidnappers. But he never expected to end up in Tanzania, at the wrong end of a hostage situation with the most intriguing doctor he's ever met. Now, he'll do anything to get them out of the deadly web they've landed in - and keep the woman of his dreams safe. Should be easy for an ex-Delta Force operator, right? He wishes....</p> <p>No one kidnaps animal migration specialists. Or so Meg Finley thought - until she found herself in the clutches of terrorists, that is. She needs to keep her wits about her now more than ever. She can't let herself be distracted by an untimely attraction to her ridiculously appealing protector. But...she is....</p> <p>It will take all of Meg and Honey's combined strength, knowledge, and skill to survive. But when all is said and done, will it be enough to get them to happily ever after?</p> <p><i>Deadlock</i> is an intense, action adventure military romance suspense thriller filled with spies, conspiracies, and international terror.</p> <p>Contains mature themes.</p>"; 
